layout: stacked
style: dark
remote_theme: pages-themes/midnight@v0.2.0

plugins:
  - jekyll-octicons
  - jekyll-github-metadata
  - jemoji
  - jekyll-remote-theme

permalink: /:year/:month/:day/:title/

defaults:
  -
    scope:
      path: "" # an empty string here means all files in the project
      type: "posts"
    values:
      layout: "post"

projects:
  sort_by: pushed
  # sort_by options:
  #   - pushed
  #   - stars
  limit: 9
  exclude:
    archived: false
    projects: 
                hacktoberfest-2021
                HacktoberFest2021-2
